import './App.css';
import Page2 from './Page2.js';
import { BrowserRouter as Route } from 'react-router-dom';
import Login from './LogIn/Login';
function App() {
  return (
    <div className="App">
      <Route exact path="/" component={Login} />
      <Route exact path="/Page2" component={Page2} />
    </div>
  );
}

export default App;
